import style from "./MyCard.module.css"
import { useSelector } from "react-redux"


const MyCard =(props)=>{
    let front =style[""]
    let back = style[""]
    const flipCard = useSelector(state=>state.myPage.flipCard)

    if (flipCard){
        front =style["flip-card-front"]
        back = style["flip-card-back"]
    }else{
        back =style["flip-card-front"]
        front = style["flip-card-back"]
    }

    
    return <div className={style.card}>
        <div className={style['flip-card-inner']}>

            <div className={front}>
                <div className={style["front-card"]}>
                    <img className={style.myImage} src={props.card_element.image} alt=""></img>
                    <div className={style.title}>
                        {props.card_element.name}
                    </div>
                    <div className={style.text}>
                        {"Owner: " + (props.card_element.owner ? props.card_element.owner : "-")}
                    </div>
                </div>
            </div>

            <div className={back}>
                <div className={style["back-card"]}>
                    test
                    <br/>
                    {props.my_number}
                </div>
           </div>
        </div>
    </div>

}
// style["back-card"]
// style["back-card"]
export default MyCard
